import { useState } from "react";
import { IResponseData } from "../interfaces/IResponseData";

export const useFetchData = (initialValue: any) => {
	const [value, setValue] = useState(initialValue);

	const myFn = () => {
		console.log(value);
		setValue(value + 1);
	};

	return [value, myFn];
};
